window.bookSummaryJSON = "<p>With Alice determined to discover the truth about her past and Seth determined to help her, the couple find themselves sucked into a world where nothing is as it seems and no one can be trusted. On the run to escape a mad queen's wrath and with an entire realm looking for them, tensions fray and friendships are tested.</p> <p>Even worse for Seth, shocking secrets he'd rather leave buried are brought to the surface.</p> <p>Joined on their adventure by an irritable Gus and a mysterious Eva, the four friends must learn the truth of Alice's past so she can forge her future.</p> <p>But a future with whom? And where?</p> <p>The Ministry of Curiosities series is now complete. It contains the following works:</p> <p></p> <ol> <li><i>The Last Necromancer</i></li> <li><i>Her Majesty's Necromancer</i></li> <li><i>Beyond the Grave</i></li> <li><i>Grave Expectations</i></li> <li><i>Ashes to Ashes</i></li> <li><i>From the Ashes</i></li> <li><i>Of Fate and Phantoms</i></li> <li><i>Veiled in Moonlight</i></li> <li><i>Vow of Deception</i></li> <li><i>The Wisdom of Madness</i></li> </ol>"; 
